    false,nt"url": null,nt"notes": "This document provides guidelines for monitoring,
    and controlling avian disease outbreaks on San Luis National Wildlife Refuge (NWR)
    Complex Grasslands Wildlife Management Area (WMA) , and the Modesto Area. It is
    intended as a local supplement to the FWS-CDF&G Interagency Disease Contingency
    Plan signed in 1982 (Appendix I). The objective of the plan is to provide early
    detection, identification, and response to disease outbreaks in order to minimize
    losses of wildlife.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
